function iRandom_randomInt_FromRange(t,n){return Math.floor(Math.random()*(n-t+1))+t}function iRandom_randomFloat_FromRange(t,n){return Math.random()*(n-t+1)+t}function IntRange(t,n){var r=[];for(let e=t;e<=n;e++)r.push(e);return r}function percentOfNum(t,n){return t/n*100+"%"}function numOfPercent(t,n){return t/100*n}function maxNumofPercentNum(t,n){return t/(n/100)}function DateNumber(){let t=new Date,n=t.getFullYear(),r=t.getMonth()+1;r<10&&(r="0"+r);let e=t.getDate();e<10&&(e="0"+e);let o=t.getHours();o<10&&(o="0"+o);let a=t.getMinutes();a<10&&(a="0"+a);let u=t.getSeconds();u<10&&(u="0"+u);let i=t.getMilliseconds();i<10&&(i="00"+i),i<100&&(i="0"+i);let c=n.toString()+r.toString()+e.toString(),h=o.toString()+a.toString()+u.toString()+i.toString();return Number(c+h)}function iRandom_charactersAll(t){let n="",r="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789",e=r.length;for(let o=0;o<t;o++)n+=r.charAt(Math.floor(Math.random()*e));return n}function iRandom_charactersNums(t){let n="",r="0123456789".length;for(let e=0;e<t;e++)n+="0123456789".charAt(Math.floor(Math.random()*r));return n}function iRandom_charactersUletters(t){let n="",r="ABCDEFGHIJKLMNOPQRSTUVWXYZ".length;for(let e=0;e<t;e++)n+="ABCDEFGHIJKLMNOPQRSTUVWXYZ".charAt(Math.floor(Math.random()*r));return n}function iRandom_charactersLletters(t){let n="",r="abcdefghijklmnopqrstuvwxyz".length;for(let e=0;e<t;e++)n+="abcdefghijklmnopqrstuvwxyz".charAt(Math.floor(Math.random()*r));return n}function iRandom_charactersULletters(t){let n="",r="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz",e=r.length;for(let o=0;o<t;o++)n+=r.charAt(Math.floor(Math.random()*e));return n}function iRandom_random_hex(){return"#"+(16777215*Math.random()<<0).toString(16)}function iRandom_random_rgba(){let t=Math.round,n=Math.random;return"rgba("+t(255*n())+","+t(255*n())+","+t(255*n())+","+n().toFixed(2)+")"}function iRandom_random_rgb(){let t=Math.round,n=Math.random;return"rgba("+t(255*n())+","+t(255*n())+","+t(255*n())+")"}function iRandom_random_hsl(){let t=Math.round,n=Math.random;return"hsl("+t(360*n())+", "+t(100*n())+"%, "+t(100*n())+"%)"}function iRandom_hwb(){let t=Math.round,n=Math.random;return"hwb("+t(360*n())+", "+t(100*n())+"%, "+t(100*n())+"%)"}function iRandom_cmyk(){var t=Math.round,n=Math.random;return"cmyk("+(t(100*n())+"%")+", "+(t(100*n())+"%")+", "+(t(100*n())+"%")+", "+(t(100*n())+"%")+")"}function iRandom_cmy(){var t=Math.round,n=Math.random;return"cmy("+(t(100*n())+"%")+", "+(t(100*n())+"%")+", "+(t(100*n())+"%")+")"}function iRandom_choice(t){let n=t.length;for(let r=0;r<1;r++)myChoice=t.charAt(Math.floor(Math.random()*n));return myChoice}function combinations_k(t,n){var r,e,o,a,u;if(n>t.length||n<=0)return[];if(n==t.length)return[t];if(1==n){for(o=[],r=0;r<t.length;r++)o.push([t[r]]);return o}for(o=[],r=0;r<t.length-n+1;r++)for(a=t.slice(r,r+1),u=combinations_k(t.slice(r+1),n-1),e=0;e<u.length;e++)o.push(a.concat(u[e]));return o}function combinations(t){var n,r,e,o;for(e=[],n=1;n<=t.length;n++)for(o=combinations_k(t,n),r=0;r<o.length;r++)e.push(o[r]);return e}function String2Num(t,n){let r="";t=t.split("").reverse().join("");for(let e=1;e<=t.length;e++)r+=t.charCodeAt(t.length-e)*(e+n);return r}function fibonacciSeq(t){if(1===t)return[0,1];{let n=fibonacciSeq(t-1);return n.push(n[n.length-1]+n[n.length-2]),n}}function fibonacciNum(t){return t<=0?0:t<=1&&t<=2?1:fibonacci(t-1)+fibonacci(t-2)}function ariNum(t,n,r){return n+r*(t-1)}function ariSeq(t,n,r){let e=[n,n+r];for(let n=3;n<=t;n++)e.push(e[e.length-1]+r);return e}function geoNum(t,n,r){return n*Math.pow(r,t-1)}function geoSeq(t,n,r){let e=[n,n*r];for(let n=3;n<=t;n++)e.push(e[e.length-1]*r);return e}function triNum(t){return t*(t+1)/2}function triSeq(t){let n=[1,3];for(let r=3;r<=t;r++)n.push(r*(r+1)/2);return n}function seriesSum(t){var n=0;for(let r=1;r<=t;r++)n+=r*(r+1)/2;return n}